import React, { Component } from "react";
import axios from "axios";
export class SearchResults extends Component {
  constructor(props) {
    super(props);
    this.state = {
      searchResults: [],
      searchQuery: ""
    };
  }

  componentDidMount() {
    this.getSearchResults();
  }

  getSearchResults = () => {
    axios
      .get(
        `https://api.themoviedb.org/3/search/multi?api_key=170638d59cd41f58852a2f12564d2503&language=en-US&query=the%20flash&page=1&include_adult=false`
      )
      .then(data => console.log(data.data));
  };

  render() {
    console.log(this.props);
    return (
      <div className="container text-white py-4 text-center">
        <h1>Search Results for {this.props.location.search}</h1>
      </div>
    );
  }
}

export default SearchResults;
